import { Squash as Hamburger } from "hamburger-react";

const Filter = () => {
  return (
    <>
      <div id="filter-box" >
        <div id="filtered-element"></div>
        <div id="menu-button">
          <Hamburger rounded size={28} />
        </div>
      </div>
    </>
  );
};
export default Filter;
